let homenestCurrentPage = 0;
const homenestItemsPerPage = 4;
const homenestTotalPages = Math.ceil(
  homenestFeatures.length / homenestItemsPerPage
);

function homenestRenderFeatures() {
  const container = document.getElementById("homenest-features-container");
  const startIndex = homenestCurrentPage * homenestItemsPerPage;
  const endIndex = startIndex + homenestItemsPerPage;
  const currentFeatures = homenestFeatures.slice(startIndex, endIndex);

  container.innerHTML = "";

  currentFeatures.forEach((feature, index) => {
    const card = document.createElement("div");
    card.className = "homenest-feature-card";
    card.innerHTML = `
                    <div class="homenest-feature-icon">${feature.icon}</div>
                    <h3 class="homenest-feature-title">${feature.title}</h3>
                    <p class="homenest-feature-description">${feature.description}</p>
                `;
    container.appendChild(card);

    // Animate card appearance
    setTimeout(() => {
      card.classList.add("homenest-active");
    }, index * 100);
  });

  homenestUpdateNavButtons();
}

function homenestUpdateNavButtons() {
  const prevBtn = document.getElementById("homenest-prev-btn");
  const nextBtn = document.getElementById("homenest-next-btn");

  prevBtn.disabled = homenestCurrentPage === 0;
  nextBtn.disabled = homenestCurrentPage === homenestTotalPages - 1;
}

function homenestNextPage() {
  if (homenestCurrentPage < homenestTotalPages - 1) {
    homenestCurrentPage++;
    homenestRenderFeatures();
  }
}

function homenestPrevPage() {
  if (homenestCurrentPage > 0) {
    homenestCurrentPage--;
    homenestRenderFeatures();
  }
}

// Initialize the component
homenestRenderFeatures();
function scrollCards(direction) {
  const card = document.querySelector(".hn-card");

  if (!card) return;

  const cardWidth = card.offsetWidth + 24;// adjust based on card width
  console.log(cardWidth);
  container.scrollBy({
    left: direction * cardWidth,
    behavior: "smooth",
  });
}
